import logo from './logo.svg';
import './App.css';

import React from 'react';

class Homepage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      carouselImages: [
        'image1.jpg',
        'image2.jpg',
        'image3.jpg'
      ],
      itemsList: [
        'Item 1',
        'Item 2',
        'Item 3',
        'Item 4',
        'Item 5',
        'Item 6',
        'Item 7',
        // Add more items as needed
      ],
      searchQuery: ''
    };
  }

  handleSearchChange = (event) => {
    this.setState({ searchQuery: event.target.value });
  }

  handleSearch = () => {
    // Here you can implement search functionality using this.state.searchQuery
    // For simplicity, let's just log the search query for now
    console.log("Searching for:", this.state.searchQuery);
  }

  render() {
    const { carouselImages, itemsList, searchQuery } = this.state;

    return (
      <div>
        <div className="banner">
          <div className="logo">
            <img src="logo.png" alt="Logo" />
          </div>
          <h1 className="title">Fridge2Food</h1>
          <nav className="ribbon">
            <ul>
              <li><a href="/login">Login</a></li>
              <li><a href="/my-fridge">My Fridge</a></li>
            </ul>
          </nav>
        </div>

        <div className="carousel">
          <h2>Featured Recipes</h2>
          <div className="carousel-inner">
            {carouselImages.map((image, index) => (
              <img key={index} src={image} alt={`Carousel Image ${index}`} />
            ))}
          </div>
        </div>

        <div className="search-recipes">
          <h2>Search Recipes</h2>
          <div className="search-container">
            <input type="text" placeholder="Search..." value={searchQuery} onChange={this.handleSearchChange} />
            <button onClick={this.handleSearch}>Search</button>
          </div>
        </div>

        <div className="item-list">
          <h2>Items</h2>
          <ul>
            {itemsList.map((item, index) => (
              <li key={index}>{item}</li>
            ))}
          </ul>
        </div>
      </div>
    );
  }
}

export default Homepage;
